description:
UltraISO Premium Edition v9.3.3.2685 made Portable.

No need to install it!
Or, if you want to, Setup and Key are included. Just copy the uikey.ini file into the install dir...



                       UltraISO revision history 

61, UltraISO Premium 9.33 (February 11, 2009) 
  +) Can open, view and extract files from XBOX360 ISO images
     and non copy-protected XBOX360 DVD's
  +) Supports mounting UDF DVD images on Windows Vista/Windows 7 Beta1 (ISODrive)
  +) Saves newly detected media capacity
  *) Improveed performance for editing bootable ISO's with large boot image file
  *) Can detect and use Nero 9 as default burning software
  *) Fixed a compatible problem with Ashampoo burning package
  *) Fixed a bug with converting some PlayStation CD images in MDS/MDF format
  *) Some minor improvements and bug fixes 


More infos at
 &lt;a href=&quot;
http://www.ezbsystems.com/ultraiso/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.ezbsystems.com/ultraiso/&lt;/a&gt;



The Portable SFX EXE file is built up using WinRAR. You can use it to extract the files and check them one by one if you want to be sure of what is running on your machine.


This also has been built up on an XP x86 machine, I don't know if this program can run on a x64 or Vista machine. I't's up to you to check it if you are using them.


SUGGESTIONS ON USING P2P DOWNLOADS
==================================

1) It's always better to run all downloaded programs using Sandboxie or a similar virtual machine until you are sure they are clean.


2) When in doubt, scan them with an Internet Scan service as the ones provided by Jotti and VirusTotal
 &lt;a href=&quot;
http://virusscan.jotti.org/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://virusscan.jotti.org/&lt;/a&gt;
 &lt;a href=&quot;
http://www.virustotal.com/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.virustotal.com/&lt;/a&gt;

This will ***NOT*** give you any warranty that a file passing their analysis is clean, nor that if they see them as a troian it's so or not just another false positive, but helps you to decide and at least ask for help or infos.


3) Remember, trust nobody, and when in doubt, go to point 1) 


4) If you find any upload containing trojans or whatsoever malicious or unclean, instead of start cursing in the comments of the upload, take the time to go to the Suprbay Forum at:
 &lt;a href=&quot;
http://suprbay.org/forumdisplay.php?f=34&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://suprbay.org/forumdisplay.php?f=34&lt;/a&gt;

and report links and comments there, and someone will take care of all the nasties.


That's the only way to keep TPB and its uploads fresh and clean.


